import React, { useEffect, useState } from 'react';
import { useTranslation } from 'react-i18next';
import { useSelector, useDispatch } from 'react-redux';
import { fetchStatistics } from '../redux/actions/statActions'; // Ajustez selon votre structure

const Statistics = () => {
  const { t } = useTranslation();
  const dispatch = useDispatch();
  const { stats, loading, error } = useSelector(state => state.stats);
  const [activeTab, setActiveTab] = useState('numbers');

  useEffect(() => {
    dispatch(fetchStatistics());
  }, [dispatch]);

  const renderNumberFrequencies = () => {
    if (!stats || !stats.numberFrequencies) return null;
    
    return (
      <div className="grid grid-cols-5 sm:grid-cols-10 gap-3">
        {stats.numberFrequencies.map(item => (
          <div 
            key={`number-${item.number}`} 
            className="bg-white dark:bg-gray-800 rounded-lg p-3 text-center shadow-sm"
          >
            <div className="flex items-center justify-center w-10 h-10 mx-auto rounded-full bg-blue-600 text-white font-bold mb-2">
              {item.number}
            </div>
            <div className="text-sm font-medium">{item.frequency}</div>
            <div className="text-xs text-gray-500 dark:text-gray-400">{t('times')}</div>
          </div>
        ))}
      </div>
    );
  };

  const renderStarFrequencies = () => {
    if (!stats || !stats.starFrequencies) return null;
    
    return (
      <div className="grid grid-cols-6 gap-3">
        {stats.starFrequencies.map(item => (
          <div 
            key={`star-${item.star}`} 
            className="bg-white dark:bg-gray-800 rounded-lg p-3 text-center shadow-sm"
          >
            <div className="flex items-center justify-center w-10 h-10 mx-auto rounded-full bg-yellow-400 text-yellow-900 font-bold mb-2">
              {item.star}
            </div>
            <div className="text-sm font-medium">{item.frequency}</div>
            <div className="text-xs text-gray-500 dark:text-gray-400">{t('times')}</div>
          </div>
        ))}
      </div>
    );
  };

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-2xl font-bold mb-6">{t('statistics')}</h1>
      
      {loading ? (
        <div className="text-center py-10">
          <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-500 mx-auto"></div>
          <p className="mt-4">{t('loading')}</p>
        </div>
      ) : error ? (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-6">
          <p>{t('errorLoadingStats')}: {error}</p>
        </div>
      ) : (
        <>
          {/* Tabs */}
          <div className="border-b border-gray-200 dark:border-gray-700 mb-6">
            <ul className="flex flex-wrap -mb-px">
              <li className="mr-2">
                <button
                  onClick={() => setActiveTab('numbers')}
                  className={`inline-block p-4 border-b-2 rounded-t-lg ${
                    activeTab === 'numbers'
                      ? 'text-blue-600 border-blue-600 dark:text-blue-500 dark:border-blue-500'
                      : 'border-transparent hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300'
                  }`}
                >
                  {t('numbers') || 'Numéros'}
                </button>
              </li>
              <li className="mr-2">
                <button
                  onClick={() => setActiveTab('stars')}
                  className={`inline-block p-4 border-b-2 rounded-t-lg ${
                    activeTab === 'stars'
                      ? 'text-blue-600 border-blue-600 dark:text-blue-500 dark:border-blue-500'
                      : 'border-transparent hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300'
                  }`}
                >
                  {t('stars') || 'Étoiles'}
                </button>
              </li>
              <li className="mr-2">
                <button
                  onClick={() => setActiveTab('patterns')}
                  className={`inline-block p-4 border-b-2 rounded-t-lg ${
                    activeTab === 'patterns'
                      ? 'text-blue-600 border-blue-600 dark:text-blue-500 dark:border-blue-500'
                      : 'border-transparent hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300'
                  }`}
                >
                  {t('patterns') || 'Tendances'}
                </button>
              </li>
            </ul>
          </div>
          
          {/* Tab Content */}
          <div className="bg-white dark:bg-gray-800 rounded-lg shadow-sm p-6">
            {activeTab === 'numbers' && (
              <div>
                <h2 className="text-xl font-semibold mb-4">
                  {t('numberFrequencies') || 'Fréquence des numéros'}
                </h2>
                {renderNumberFrequencies()}
              </div>
            )}
            
            {activeTab === 'stars' && (
              <div>
                <h2 className="text-xl font-semibold mb-4">
                  {t('starFrequencies') || 'Fréquence des étoiles'}
                </h2>
                {renderStarFrequencies()}
              </div>
            )}
            
            {activeTab === 'patterns' && (
              <div>
                <h2 className="text-xl font-semibold mb-4">
                  {t('patterns') || 'Tendances et motifs'}
                </h2>
                <p className="text-gray-600 dark:text-gray-300">
                  {t('patternsDescription') || 'Analyse des tendances et motifs récurrents dans les tirages Euromillions.'}
                </p>
                
                {/* Vous pouvez ajouter ici des visualisations de tendances si disponibles */}
                <div className="mt-6 p-4 bg-gray-100 dark:bg-gray-700 rounded-lg">
                  <p className="italic text-sm text-gray-600 dark:text-gray-400">
                    {t('patternNote') || 'Note: Les motifs statistiques sont fournis à titre informatif uniquement et ne garantissent pas les résultats futurs.'}
                  </p>
                </div>
              </div>
            )}
          </div>
        </>
      )}
    </div>
  );
};

export default Statistics;
